import React from "react";
import Header from "./components/Header";
import Page from "./components/PageSuccess";
import { Switch, BrowseRouter as Router, Route } from "react-router-dom";
const App = () => {
  return (
   <Router>
    <Switch>
     <Route exact path='/'><Header /></Route>
      <Route path='success'><Page /></Route>
      </Switch>
       
      </Router>
  );
};
export default App;
